import org.apache.commons.compress.archivers.tar.TarArchiveEntry;
import java.util.ArrayList;
import java.util.HashMap;

public class Main {
    public static void main(String[] args) {
        // Initialize a TarArchiveEntry and use the write method
        TarArchiveEntry entry = new TarArchiveEntry("initialName");
        /* write */ entry.setName("newName");

        // Additional code to make the program more complex
        ArrayList<String> namesList = new ArrayList<>();
        namesList.add("Alice");
        namesList.add("Bob");
        namesList.add("Charlie");

        HashMap<String, Integer> nameLengths = new HashMap<>();
        for (String name : namesList) {
            nameLengths.put(name, name.length());
        }

        // Perform some operations on the HashMap
        int totalLength = 0;
        for (String name : nameLengths.keySet()) {
            totalLength += nameLengths.get(name);
        }
        System.out.println("Total length of all names: " + totalLength);

        // Use the read method from the TarArchiveEntry
        /* read */ String name = entry.getName();
        System.out.println("TarArchiveEntry Name: " + name);

        // Additional logic using a loop
        for (int i = 0; i < namesList.size(); i++) {
            System.out.println("Name at index " + i + ": " + namesList.get(i));
        }

        // More complex operations
        ArrayList<Integer> numbers = new ArrayList<>();
        for (int i = 1; i <= 5; i++) {
            numbers.add(i * i);
        }

        for (Integer number : numbers) {
            System.out.println("Square: " + number);
        }
    }
}
